import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';


function Footer(){
    return(
        <footer className="bg-light py-3">
            <p className="footer-text">Nahuel Martin Palma</p>
            <p className="footer-text"><a href="mailto:nahuelmartin.palma@estudiantes.unahur.edu.ar">Correo</a></p>

        </footer>
    );
}

export default Footer;
